–∏–ª—å–Ω–æ –ª–∏ –Ω–∞—Å—Ç—Ä–æ–µ–Ω –≤–∞—à –º–µ—Ç–æ–¥ –æ—Ç–ø—Ä–∞–≤–∫–∏.','We appreciate your continued interest in our updates. Expect to hear from us again soon!'=>'–ú—ã —Ü–µ–Ω–∏–º –≤–∞—à –ø–æ—Å—Ç–æ—è–Ω–Ω—ã–π –∏–Ω—Ç–µ—Ä–µ—Å –∫ –Ω–∞—à–∏–º –æ–±–Ω–æ–≤–ª–µ–Ω–∏—è–º. –û–∂–∏–¥–∞–π—Ç–µ –Ω–æ–≤—ã—Ö —Å–æ–æ–±—â–µ–Ω–∏–π –æ—Ç –Ω–∞—Å –≤ –±–ª–∏–∂–∞–π—à–µ–µ –≤—Ä–µ–º—è!','Thank you for letting us know!'=>'–°–ø–∞—Å–∏–±–æ, —á—Ç–æ –¥–∞–ª–∏ –Ω–∞–º –∑–Ω–∞—Ç—å!','Unable to deactivate re-engagement emails: %s'=>'–ù–µ–≤–æ–∑–º–æ–∂–Ω–æ –æ—Ç–∫–ª—é—á–∏—Ç—å –ø–æ–≤—Ç–æ—Ä–Ω—É—é —Ä–∞—Å—Å—ã–ª–∫—É –ø–∏—Å–µ–º: ','All emails must include an "Unsubscribe" link. Add a footer widget to your email to continue.'=>'–í—Å–µ —ç–ª–µ–∫—Ç—Ä–æ–Ω–Ω—ã–µ –ø–∏—Å—å–º–∞ –¥–æ–ª–∂–Ω—ã —Å–æ–¥–µ—Ä–∂–∞—Ç—å —Å—Å—ã–ª–∫—É "–û—Ç–∫–∞–∑–∞—Ç—å—Å—è –æ—Ç –ø–æ–¥–ø–∏—Å–∫–∏". –î–ª—è –ø—Ä–æ–¥–æ–ª–∂–µ–Ω–∏—è –¥–æ–±–∞–≤—å—Ç–µ –≤ –ø–∏—Å—å–º–æ –≤–∏–¥–∂–µ—Ç —Ñ—É—Ç–µ—Ä–∞.','Poet, please add prose to your masterpiece before you send it to your followers.'=>'–ü–æ—ç—Ç, –ø–æ–∂–∞–ª—É–π—Å—Ç–∞, –¥–æ–±–∞–≤—å—Ç–µ –ø—Ä–æ–∑—ã –∫ —Å–≤–æ–µ–º—É —à–µ–¥–µ–≤—Ä—É, –ø—Ä–µ–∂–¥–µ —á–µ–º –æ—Ç–ø—Ä–∞–≤–ª—è—Ç—å –µ–≥–æ —Å–≤–æ–∏–º –ø–æ–¥–ø–∏—Å—á–∏–∫–∞–º.','Re-engagement emails are disabled because open and click tracking is disabled in MailPoet ‚Üí Settings ‚Üí Advanced.'=>'–ü–∏—Å—å–º–∞ —Å –ø–æ–≤—Ç–æ—Ä–Ω—ã–º –ø—Ä–∏–≤–ª–µ—á–µ–Ω–∏–µ–º –æ—Ç–∫–ª—é—á–µ–Ω—ã, –ø–æ—Å–∫–æ–ª—å–∫—É –æ—Ç—Å–ª–µ–∂–∏–≤–∞–Ω–∏–µ –æ—Ç–∫—Ä—ã—Ç–∏–π –∏ –∫–ª–∏–∫–æ–≤ –æ—Ç–∫–ª—é—á–µ–Ω–æ –≤ MailPoet ‚Üí –ù–∞—Å—Ç—Ä–æ–π–∫–∏ ‚Üí –î–æ–ø–æ–ª–Ω–∏—Ç–µ–ª—å–Ω–æ.','Use a different email address'=>'–ò—Å–ø–æ–ª—å–∑—É–π—Ç–µ –¥—Ä—É–≥–æ–π –∞–¥—Ä–µ—Å —ç–ª–µ–∫—Ç—Ä–æ–Ω–Ω–æ–π –ø–æ—á—Ç—ã','Authorize this email address'=>'–†–∞–∑—Ä–µ—à–∏—Ç—å —ç—Ç–æ—Ç –∞–¥—Ä–µ—Å —ç–ª–µ–∫—Ç—Ä–æ–Ω–Ω–æ–π –ø–æ—á—Ç—ã','Addresses in names are not permitted, please add your name instead.'=>'–ê–¥—Ä–µ—Å–∞ –≤ –∏–º–µ–Ω–∞—Ö –Ω–µ –¥–æ–ø—É—Å–∫–∞—é—Ç—Å—è, –≤–º–µ—Å—Ç–æ —ç—Ç–æ–≥–æ —É–∫–∞–∂–∏—Ç–µ —Å–≤–æ–µ –∏–º—è.','MailPoet Sending Service has been temporarily suspended for